import fs from "fs"

export default function Gallery(props) {
  console.log(props.galleryDirectory)
  fs.readFile('/etc/hosts', 'utf8', function (err,data) {
	if (err) {
	  return console.log(err);
	}
	console.log(data);
  });
  
  return (
    <>Gallery shit</>
  )
}
